description:
If you\'re looking for a CBR and CBZ reader for your favorite OS, look no farther. Comical is an easy-to-use, featureful GUI comic book viewer, written in C++ using wxWidgets.
It\'s open-source, so feel Free to contribute!

Downloaded straight off its official website: &lt;a href=&quot;
http://comical.sourceforge.net/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://comical.sourceforge.net/&lt;/a&gt;

Even though it was last updated in 2006 it works 100% with Windows 7 (32bit)
There is also a MacOSX and Linux version (on its website)
